
options {
  port 5000;		# Listen on this port.
  timeout 5;

  max_tunnels_num 20;
  # Syslog facility
  syslog 	daemon;

  # Path to various programs
  ppp 		/usr/sbin/pppd;            
  ifconfig 	/sbin/ifconfig;
  route 	/sbin/route;
  firewall 	/sbin/iptables;
  ip		/usr/sbin/tc;
}

# Default session options 
default {
  compress no;  	# Compression is off by default
  speed 0;		# By default maximum speed, NO shaping
  proto tcp;   		# UDP|TCP protocol
  encrypt  no;		# Encryption
  keepalive yes;	# Keep connection alive
  multi killold;
  stat yes;
	tick_secs 3;
	rxmit_cnt_drop_period 1;
	max_weight_norm 15000;
	start_weight 50;
	weight_scale 1; #old - 100
	weight_smooth_div 10;
	weight_start_stickiness 0;
	weight_saw_step_up_div 60;
        weight_saw_step_up_min_step 200;
	weight_saw_step_dn_div 5;
	weight_msec_delay 20; #old - 2000
	pen_usec_immune 500000;
	max_latency 2000;
	max_latency_drop 5;
	max_allowed_buf_len 250;
	max_reorder 90;
	max_idle_timeout 20;
	frame_count_send_lws 50;
	ping_interval 2;
	tun_txqueue_len 1000;
	tcp_conn_amount 1;
    rt_mark 1;
    type tun;
}
